function makeRedirectWrapper(path) {
	return function RedirectWrapper({location}) {
		return <Redirect to={path + location.search} />;
	}
}

export const Routes = (props) => {
		const theme = props.theme && props.theme.name ? props.theme.name : THEME_MAIN;
		return (
			<Switch>
				<Redirect exact from='/index.html' to='/' />
					{props.user.is_admin && <Route path='/admin/payments_requests' component={AdminBuhPage} />
					}
					{props.user.is_admin && <Route path='/admin/payments' component={AdminBuhPage} />
					}
					{props.user.is_admin && <Route exact {...props} path='/admin/buh-users/:id' component={AdminBuhPage}/>}
					{props.user.is_admin && <Route {...props} path='/admin/buh-users' component={AdminBuhPage}/>}
					{/* {props.user.is_admin && 
					<Route path='/admin/buh-users'>
						<Switch>
						<Route exact {...props} path='/admin/buh-users' component={AdminBuhPage}/>
						<Route exact {...props} path='/admin/buh-users/:type/:id' component={AdminBuhPage}/>
						</Switch>
					</Route>} */}
					{props.user.is_admin && <Route exact path='/dsh' component={TestAppDSH} />
					}
					{props.user.is_admin && <Route exact path='/admin/questionnaire' component={AdminBuhPage} />
					}
					{props.user.is_admin && <Route exact path='/admin/operation' component={AdminBuhPage} />
					}
					{props.user.is_admin && <Route exact path='/admin/orders' component={AdminBuhPage} />
					}

					<Route exact path='/games-online' component={CatalogBrowserGamePage} />
					<Route exact path='/game/:id' component={FlashGamePage} />
					<Route exact path='/welcome' component={WelcomePage} />
					<Route exact path='/subscribe' component={InfoSubscribePage} />

					{/*<Route path='/cpa-offer' component={CPAPage} />*/}

					<Route exact path='/' render={p => theme === THEME_GAMER || theme === THEME_ANTIQUARY ? (
						<CommonPage {...props} {...p} />
					) : (
						<IndexPage {...p} />
					)} />

					<Route path='/wiki'>
						<Switch>
							<AuthRoute {...props} exact path='/wiki/:type/:id/edit' component={WikiEditPage} />
							<AuthRoute {...props} exact path='/wiki/post/new' component={WikiEditPage} />
							<Route exact {...props} path='/wiki/:game' component={WikiMainPage}/>
							<Route exact {...props} path='/wiki/:game/:type' component={WikiMainPage}/>
							<Route exact {...props} path='/wiki/:game/:type/:name' component={WikiMainPage}/>
							<Route path='/wiki/*/*/*/*' component={ UrlResolver } />
							{/* <Route path='/wiki/:game/:type/:name/*' component={ UrlResolver } /> */}
							<Route exact {...props} path='/wiki' component={WikiMainPage}/>
						</Switch>
					</Route>

					<Route exact {...props} path='/dota2' 
						render={p => <CommonPage {...props} {...p} />}/>
					<Route exact {...props} path='/csgo' 
						render={p => <CommonPage {...props} {...p} />}/>
					<Route exact {...props} path='/teamfortress2' 
						render={p => <CommonPage {...props} {...p} />}/>
					<Route exact path='/search' component={SearchPage} />
					<Route exact path='/hashTagSearch' component={HashTagsPage} />
					<Route path='/ref/:id' component={ReferalResolver} />
					<Route path='/audio' component={MusicPage} />
					<Route path='/author/:id' component={AuthorPage} />
					<Route path='/partner/:id' component={PartnerResolver} />
					<Route exact path='/products'
						component={theme === THEME_GAMER || theme === THEME_ANTIQUARY ? makeRedirectWrapper('/') : CatalogPage}
						title=""/>
					<Redirect exact from='/product' to='/products' />
					<Route path='/product'>
						<Switch>
							<Route {...props} path='/product/upload' component={UploadProductsPage} />
							<Route path='/product/newCommon' component={NewProductPage} />
							{/*<Route path='/product/newGamer' component={EditProductPage} />*/}
							{/* <Route {...props} path='/product/new' render={p => theme === THEME_GAMER || theme === THEME_ANTIQUARY ? (
									<EditProductPage {...props} {...p} />
								) : (
									<NewProductPage {...props} {...p} />
								)} /> */}
							{theme === THEME_GAMER || theme === THEME_ANTIQUARY ? (
								<AuthRoute {...props} path='/product/new'  
								render={p => <EditProductPage {...props} {...p} />}/>
							) : (
								<Route {...props} path='/product/new' 
								render={p => <NewProductPage {...props} {...p} />}/>
							)}
							<AuthRoute {...props} path='/product/:id/edit' render={p => theme === THEME_GAMER || theme === THEME_ANTIQUARY ? (
									<EditProductPage {...props} {...p} />
								) : (
									<NewProductPage {...props} {...p} />
								)} />
							<Route path='/:type/:id/comments' component={CommentsPage} />
							<Route path='/:type/:id/reviews' component={ReviewsPage} />
							<Route path='/product/:id' component={ProductResolver} />
						</Switch>
					</Route>

					{/*<AuthRoute exact {...props} path='/feed/news' component={ FeedPage } />*/}
					<Route exact path='/feed' component={ FeedPage } />
					<Route path='/feed/:type?' component={ FeedPage } />
					<AuthRoute {...props} path='/settings' component={ UserSettingsPage }  />
					<AuthRoute {...props} path='/notifications' component={ NotificationsPage } />

					<Route exact path='/users' component={ UsersPage } />
					<Route exact path='/user/:id' component={ UrlResolver } />
					<Route exact path='/user/:id/friends' component={ FriendsPage } />
					<Route path='/user/:id'>
						<Switch>
							<Route path='/:type/:id/reviews/:role?' component={ReviewsPage} />
							<Route exact path='/:type/:id/photos' component={ PhotosPage } />
							<AuthRoute {...props} path='/:type/:id/photos/newAlbum' component={ AlbumPage } />
							<Route path='/:type/:id/photos/:album_id' component={ AlbumPage } />

							<Route path='/user/:id/friends'>
								<Switch>
									<Route path='/user/:id/friends/common'>
										<Switch>
											<Route exact path='/user/:id/friends/:type' component={ FriendsPage } />
										</Switch>
									</Route>
									<AuthRoute {...props} exact path='/user/:id/friends/:type' component={ FriendsPage } />
									<AuthRoute {...props} path='/user/:id/friends/:type/:request' component={ FriendsPage }/>
								</Switch>
							</Route>
						</Switch>
					</Route>

					{!props.user.id && <Route path='/favorites' component={ FavoritesNonAuth } />}
					{props.user.id && <Redirect exact from='/favorites' to='/my/favorites' />}

					<AuthRoute {...props} exact path='/my' component={ UserPage } />
					<AuthRoute {...props} allowUnconfirmed={true} path='/my/messages/:opponent_id' component={ MessagesPage } />
					<AuthRoute {...props} path='/my'>
						<Switch>

							<Route exact path='/my/messages' component={ DialogsPage } />
							<Route path='/my/subscriptions/:type?' component={ SubscriptionsPage } />
							<Route path='/my/favorites' component={ SubscriptionsPage } />
							<Route path='/my/mentors' component={ MentorsPage } />

							<Route path='/my/products' component={ MyProductsPage } />
							<Route path='/my/purchase' component={ MyPerchasePage } />
							<Route exact path='/my/reviews' component={ MyReviewsPage } />
							<Route path='/my/reviews/:type' component={ MyReviewsPage } />

							<Route path={`/my/${ORDERS_KEY}`}>
								<Switch>
									<Route exact path='/my/:type' component={CartPage} />
									<Route exact path='/my/:type' component={CartPage} />
									<Route exact path='/my/orders/:id' component={OrderPage} />
									<Route path='/my/orders/:id/confirm' component={ConfirmOrderPage} />
								</Switch>
							</Route>
							<Route path={`/my/${CART_KEY}`}>
								<Route exact path='/my/:type' component={CartPage} />
							</Route>
							<Route path={`/my/${GIFT_KEY}`}>
								<Route exact path='/my/:type' component={CartPage} />
							</Route>
							<Route component={NotFound} />
						</Switch>
					</AuthRoute>
					<Route exact path='/partner' component={ CPAPage } />
					<Route path='/images/:id' component={ImagePage} />
					<Route path='/wall/:id' component={WallPostPage} />

					<Route exact path='/shop/all' component={ShopsPage} />
					<Route path='/shop/all/:type' component={ShopsPage} />

					{/* <Redirect exact from='/shops' to='/shops/' /> */}
					<Route exact path='/shop/:id' component={ UrlResolver } />
					<Route exact path='/shop/:id/dota2' component={ ShopSingle } />
					<Route exact path='/shop/:id/csgo' component={ ShopSingle } />
					<Route exact path='/shop/:id/teamfortress2' component={ ShopSingle } />
					<Route exact path='/shop/new/edit'>
						<Switch>
							<Route exact path='/shop/:id/edit' component={ShopSettings} />
						</Switch>
					</Route>
					<Route path='/shop/:id'>
						<Switch>
							<AuthRoute exact {...props} path='/shop/:id/edit' component={ ShopSettings } />
							<Route exact path='/:type/:id/reviews/:role?' component={ReviewsPage} />
							<Route exact path='/:type/:id/subscribers' component={ SubscribersPage } />
							<Route exact path='/:type/:id/photos' component={ PhotosPage } />
							<AuthRoute exact {...props} path='/:type/:id/photos/newAlbum' component={ AlbumPage } />
							<Route exact path='/:type/:id/photos/:album_id' component={ AlbumPage } />

							<AuthRoute exact {...props} path='/shop/:id/messages/:opponent_id' component={ MessagesPage } />
							<AuthRoute exact {...props} path='/shop/:id/messages' component={ DialogsPage } />
						</Switch>
					</Route>

					<AuthRoute {...props} path='/wallet' component={ WalletPage } />

					<Route exact path='/blog' component={ BlogList } />
					<Route path='/blog'>
						<Switch>
							<Route exact path='/:type/:id/subscribers' component={ SubscribersPage } />
							<AuthRoute {...props} exact path='/blog/post/new' component={EditPostPage} />
							<Route exact path='/blog/post/:id' component={ BlogPostResolver } />
							<AuthRoute {...props} exact path='/blog/post/:id/edit' component={EditPostPage} />
							<Route exact path='/blog/:param1?' component={ UrlResolver } />
							<Route exact path='/blog/:param1/:param2?' component={ BlogList } />
						</Switch>
					</Route>

					<Route path='/bloggers'>
						<Switch>
							<Route exact path='/bloggers' component={ BloggerPage } />
							<Route exact path='/bloggers/:param?' component={ BloggerPage } />
						</Switch>
					</Route>

					<Route exact path='/dev' component={ ApiPage } />
					<Route path='/dev/method/:group.:method' component={ ApiPage } />

					<Route path='/help'>
						<Switch>
							<Route exact path='/help' component={ Faq } />
							<Route path='/help/page/:id' component={ Faq } />
							<Route path='/help/searchPage/:q' component={ FaqSearch } />
							<Route exact path='/help/contacts' component={ContactsPage} />
							<Route path='/help/*' component={NotFound} />
						</Switch>
					</Route>

					<Route exact path='/legal' component={ Legal } />
					{/*<Route path='/search' component={SearchPage} />*/}
					<Route path='/legal/page/:id' component={ Legal } />

					{/* <Route path='/support' component={ (p) => <MessagesPage {...p} isSupport={true} />} /> */}

					<Route path='/login' component={LoginPage} />
					<Route path='/offline' component={OfflinePage} />

					<Route path='/:type/:id/comments' component={CommentsPage} />

					{/* <Route path='/:name' component={ UrlResolver } /> */}
					{/* <Route path='shop/:name' component={ UrlResolver } /> */}
					{/* <Route path='user/:name' component={ UrlResolver } /> */}

					<Route exact path='/*/*' component={ UrlResolver } />
					<Route component={NotFound} />
				</Switch>
		);
	}
